import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { NuevaCajaComponent } from './cajas/nueva-caja/nueva-caja.component';
import { NuevaCategoriaComponent } from './categorias/nueva-categoria/nueva-categoria.component';
import { NuevoClienteComponent } from './clientes/nuevo-cliente/nuevo-cliente.component';
import { NuevoProveedorComponent } from './proveedores/nuevo-proveedor/nuevo-proveedor.component';
import { NuevoUsuarioComponent } from './usuarios/nuevo-usuario/nuevo-usuario.component';

const administracionRoutes: Routes = [
  {path:'',
    children:[
      {path:'',
      loadChildren: () => import
      ('./cajas/cajas.module').then(m => m.CajasModule)},
      {path:'nueva categoria',component: NuevaCategoriaComponent},
      {path:'nuevo proveedor',component: NuevoProveedorComponent},
      {path:'nuevo usuario',component: NuevoUsuarioComponent},
      {path:'nuevo cliente',component: NuevoClienteComponent}
    ]
  }
]

@NgModule({
  imports: [
    RouterModule.forChild(administracionRoutes)
  ],
  exports:[
    RouterModule
  ]
})
export class AdministracionRoutingModule { }
